    def calculates(self):
        losts_n_m = [0.32, 0.49, 0.76, 1.06, 1.42, 1.56, 1.93, 2.34, 2.71, 3.19, 3.73, 4.01, 4.56, 5.39, 6.29, 7.11, 8.16, 10.08, 13.7, 100, 0] # затухания на магистрали
        losts_n_a = [13.7, 10.08, 8.16, 7.11, 6.29, 5.39, 4.56, 4.01, 3.73, 3.17, 2.71, 2.34, 1.93, 1.56, 1.42, 1.06, 0.76, 0.49, 0.32, 0, 100] # затухания на абонентах
        losts_r = [4.3, 7.4, 10.7, 13,9] #Затухание равномерников
        sig_m = []
        
        lost_i_m_1 = self.m1s.currentIndex() #Индексы сплиттеров
        lost_e_m_1 = self.m1_1s.currentIndex() #ИНдекс равномерника
        lost_1_m = losts_n_m[lost_i_m_1] #затухание магистрали текущее
        lost_1_a = losts_n_a[lost_i_m_1] #Затухание абонентов текущее
